import React from "react";
import "./Home.css";
import FAQ from "./FAQ"; 
const Home = () => {
  return (
    <div className="home-container">
      <h2>Welcome to Your Dashboard</h2>
      <p>This is your central hub for managing notes and user information.</p>
      <img src="https://source.unsplash.com/600x300/?technology" alt="Dashboard" />
    </div>
  );
};

export default Home;
